import React, { Component } from "react";
import { connect } from "react-redux";
import { Modal, Button } from "react-materialize";
import Loading from "../loading/Loading";
class BusinessModalDetail extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    componentDidMount() {
        this.setState({
            business: this.props.business
        });
    }

    render() {
        const { business } = this.props;
        if (business) {
            return (
                <Modal
                    actions={[
                        <Button flat modal='close' node='button' waves='green'>
                            Close
                        </Button>
                    ]}
                    style={{ boder: "none" }}
                    bottomSheet={false}
                    fixedFooter={false}
                    header={business.name}
                    id='modal1'
                    options={{
                        dismissible: true,
                        endingTop: "10%",
                        inDuration: 250,
                        onCloseEnd: null,
                        onCloseStart: null,
                        onOpenEnd: null,
                        onOpenStart: null,
                        opacity: 0.5,
                        outDuration: 250,
                        preventScrolling: true,
                        startingTop: "4%"
                    }}
                ></Modal>
            );
        } else {
            return <div></div>
        }
    }
}

const mapStateToProps = state => {
    return { provinces: state.provinces, business: state.business };
};

const mapDispatchToProps = {};

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(BusinessModalDetail);
